// SPDX-License-Identifier: AGPL-3.0-or-later

pragma solidity ^0.8.0;

import "../../interfaces/ICollateralJoin.sol";
import "../../interfaces/ISafeEngine.sol";
import "../../../interfaces/IRewardChefV2.sol";

// CHANGED: In CollateralJoin (GemJoin) I only added events.
// Added rewardChef and increaseAmount/decreaseAmount in join/exit functions

/// @dev This adapter assumes that the collateral has 18 decimals
contract CollateralJoin is ICollateralJoin {
    // --- Auth ---
    mapping (address => uint) public authorizedAccounts;
    function addAuthorization(address usr) external isAuthorized {
        authorizedAccounts[usr] = 1;
        emit AddAuthorization(usr);
    }
    function removeAuthorization(address usr) external isAuthorized {
        authorizedAccounts[usr] = 0;
        emit RemoveAuthorization(usr);
    }
    modifier isAuthorized {
        require(authorizedAccounts[msg.sender] == 1, "CollateralJoin/not-authorized");
        _;
    }

    IRewardChefV2 public rewardChef;
    ISafeEngine public safeEngine;
    bytes32 public collateralType;
    IERC20Metadata public collateral;      // Actual collateral token contract
    uint    public decimals;        // How many decimals the collateral token has
    uint    public contractEnabled; // Whether this adapter contract is enabled or not

    constructor(address safeEngine_, bytes32 collateralType_, address collateral_, address rewardChef_) public {
        authorizedAccounts[msg.sender] = 1;
        contractEnabled = 1;
        safeEngine = ISafeEngine(safeEngine_);
        collateralType = collateralType_;
        collateral = IERC20Metadata(collateral_);
        decimals = collateral.decimals();
        rewardChef = IRewardChefV2(rewardChef_);
        emit AddAuthorization(msg.sender);
    }
    function disableContract() external isAuthorized {
        contractEnabled = 0;
        emit DisableContract();
    }

    function updateRewardChef(address rewardChef_) external isAuthorized {
        rewardChef = IRewardChefV2(rewardChef_);
        emit UpdateRewardChef();
    }

    function join(address usr, uint wad) external {
        require(contractEnabled == 1, "CollateralJoin/not-contractEnabled");
        require(int(wad) >= 0, "CollateralJoin/overflow");
        safeEngine.modifyCollateralBalance(collateralType, usr, int(wad));
        rewardChef.increaseAmount(address(collateral), usr, wad, 1); // As default we set lockupPeriodSeconds to 1
        require(collateral.transferFrom(msg.sender, address(this), wad), "CollateralJoin/failed-transfer");
        emit Join(usr, wad);
    }

    function exit(address usr, uint wad) external {
        require(wad <= 2 ** 255, "CollateralJoin/overflow");
        safeEngine.modifyCollateralBalance(collateralType, msg.sender, -int(wad));
        //TODO: this doesn't work, because usr in join and in exit are different. Need to fix that and write tests,
        rewardChef.decreaseAmount(address(collateral), usr, wad);
        require(collateral.transfer(usr, wad), "CollateralJoin/failed-transfer");
        emit Exit(usr, wad);
    }
}

